<template>
	<view class="content">
		<scroll-view class="list-scroll-content" scroll-y>
			<!-- 空白页 -->
			<!-- <empty v-if="loaded === true && plist.length === 0"></empty> -->
			<view class="time">
				套餐列表信息
			</view>
			<!-- 订单列表 -->
			<view class="p-list">
				<view  class="p-item" v-for="(item,index) in plist" :style="picList[index%3]">
					<view class="p-content">
						<view class="p-name">
							{{item.title}}
						</view>
						<view class="p-desc ui-nowrap">
							<text v-for="product in item.giftProductResults">{{product.productName}},</text>
						</view>
					</view>
					<view class="p-button">
						<view class="btn" @click="navMealProduct(item)">
							立即领取
						</view>
					</view>
				</view>
			</view>
			
			<uni-load-more :status="loadingType"></uni-load-more>
		</scroll-view>
	</view>
</template>

<script>
	import uniLoadMore from '@/components/uni-load-more/uni-load-more.vue';
	import uniIcons from '@dcloudio/uni-ui/lib/uni-icons/uni-icons.vue';
	import wfalls from 'components/wfalls-flow/wfalls-flow3'
	import empty from "@/components/empty";
	export default {
		components: {
			uniLoadMore,
			uniIcons,
			empty,
			wfalls
		},
		data() {
			return {
				pageSize: 10, //页数据
				pageNum: 1, //页面
				plist:'',
				loadingType:'noMore',
				loaded:false,
				giftId:'',
				picList:[
					'background-image: url(data:image/png;base64,)',
					'background-image: url(data:image/png;base64,)',
					'background-image: url(data:image/png;base64,)'
				]
			};
		},
		//下拉刷新
		onPullDownRefresh() {
			this.pageNum = 1;
			this.loadData();
		},
		

		onLoad(options) {
			//识别当前tabItem下标
			console.log(options)
			this.giftId = options.giftId
		},
		
		onShow(){
			this.loadData('reLoad');
		},

		methods: {
			navMealProduct(item){
				uni.navigateTo({
					url:'/pages/mealList/mealProduct?giftId='+this.giftId+'&mealId='+item.id+'&productList='+JSON.stringify(item.giftProductResults)
				})
			},
			//获取订单列表
			async loadData(source) {
				//获取当前Tab项信息
				if (source === 'reLoad') {
					//tab切换只有第一次需要加载数据
					this.pageNum = 1
				}
				if (this.loadingType === 'loading') {
					//防止重复加载
					return;
				}
			
				this.loadingType = 'loading';
				setTimeout(async () => {
			
					let result = undefined
					let params;
					params = {
						"pageSize": this.pageSize,
						"pageNum": this.pageNum,
					};
					result = await this.$http.getMealInfo(params);
					if (result.code != 200) {
						return false;
					}
					let plist = result.data;
					if (this.pageNum === 1) { //下拉刷新
						this.plist = plist
						uni.stopPullDownRefresh();
					} else { //加载更多
						this.plist.forEach(item => {
							thisTabItem.plist.push(item);
						})
					}
					this.pageNum = this.pageNum + 1;
					//loaded新字段用于表示数据加载完毕，如果为空可以显示空白页
					this.loaded = true;
					if (result.data.length > 0) {
						//判断是否还有数据， 有改为 more， 没有改为noMore 
						this.loadingType = 'more';
					} else {
						this.loadingType = 'noMore';
					}
				}, 600);
			},
		},
	}
</script>

